import React from "react";

interface TaskListItemProps {
    task: Task;
}


export const TaskListItem: React.FC<TaskListItemProps> = ({
    task,
  }) => {
    return (
    <tr>
        <td><input type="checkbox"></input>{task.username}</td>
        <td>{task.phone}</td>
        <td>{task.email}</td>
        <td><span className="align-text-bottom"><img src="./icons/checkmark.png"></img></span> {task.date}</td>
        <td><button>צפייה</button><button>עריכה</button><button>מחיקה</button></td>
    </tr>  
    );
};
